import axios from "axios";
import React, { useState } from "react";

// https://api.weatherapi.com/v1/current.json?key=dec1f80e9c2c41ff81e102253240904&q=London&aqi=no
export const Form = () => {
  const [city,setCity] = useState();
  const getWeather = (e) => {
    e.preventDefault();
    axios.get("https://api.weatherapi.com/v1/current.json?key=dec1f80e9c2c41ff81e102253240904&q=London&aqi=no").then(res => console.log(res));
  }
  return (
    <form>
      <input type="text" name="city" placeholder="都市名" onChange={e=>setCity(e.target.value)} />
      {city}
      <button type="submit" onClick={getWeather}>Get Weather</button>
    </form>
  );
};

export default Form;
